function addNewMovie(movieName, movieURL, movieLink) {
  const movie = {
    id: movieList.length + 1,
    name: movieName,
    url: movieURL,
    link: movieLink
  }

  movieList.push(movie)

  updateDisplayedMovies();
}

function verifyParameters(name, url) {
  if(!name) {
    errorElement.textContent = 'É necessário colocar o nome do Torrent/Plataforma.'
    return false;
  }

  if(!(url.endsWith('.jpg') || url.endsWith('.png') || url.endsWith('.jpeg'))) {
    errorElement.textContent = 'É necessário colocar um link de uma imagem .jpg, .png ou .jpeg'
    return false;
  }

  for(let i in torrentList) {
    if(url == torrentList[i].url || name == torrentList[i].name) {
      errorElement.textContent = 'Este Torrent já existe na lista, tente adicionar um novo.'
      return false;
    }
  }

  errorElement.textContent = '';
  return true;
}

function createCardElement(movieName, imageURL, movieID, movieLink) {
  const cardDiv      = document.createElement('div');
  const cardImg      = document.createElement('img');
  const cardTitle    = document.createElement('span');
  const cardlink     = document.createElement('link');
  const removeButton = document.createElement('button');

  cardImg.src = imageURL;

  if(movieName.length > 20) {
    cardTitle.textContent = movieName.substr(0,21) + "...";
  } else {
    cardTitle.textContent = movieName;
  }

  cardDiv.setAttribute('class', 'card');
  cardDiv.setAttribute('onmouseover', 'mouseOver(event)');
  cardDiv.setAttribute('onmouseout', 'mouseOut(event)');
  cardDiv.setAttribute('title', movieName);

  removeButton.setAttribute('class', 'fa-solid fa-trash-can');
  removeButton.setAttribute('onclick', `removeMovie(${movieID})`);
  removeButton.setAttribute('title', 'Remover Filme/Série');

  cardlink.setAttribute('class', 'fa-solid fa-window');
  cardlink.setAttribute('onclick', `openLink`);
  cardlink.setAttribute('title', 'Abrir Torrent');

  cardDiv.appendChild(cardImg);
  cardDiv.appendChild(removeButton);
  cardDiv.appendChild(cardTitle);
  cardDiv.appendChild(cardlink);

  return cardDiv;
}

function updateMoviesId() {
  for(let i in movieList) {
    const ID = Number(i) + 1;

    movieList[i].id = ID;
  }
}

function updateDisplayedMovies() {
  cardsList.innerHTML = '';

  movieList.forEach((movie) => {
    const cardElement = createCardElement(movie.name, movie.url, movie.id, movie.link);

    cardsList.appendChild(cardElement);
  })
}

function removeMovie(id) {
  const index = id - 1;

  movieList.splice(index, 1);

  updateMoviesId();
  updateDisplayedMovies();
}

function mouseOver(event) {
  const allCards = document.querySelectorAll('.card');
  const target = event.target.offsetParent;

  allCards.forEach((card) => {
    if(card == target) {
      card.classList.add('show-remove')
      return;
    }

    card.classList.add('blur')
  })
}

function mouseOut(event) {
  const allCards = document.querySelectorAll('.card');
  const target = event.target.offsetParent;

  allCards.forEach((card) => {
    if(card == target) {
      card.classList.remove('show-remove')
      return;
    }

    card.classList.remove('blur')
  })
}

function openLink(cardlink) {
  const win = window.open(cardlink, 'blank')  
  win.focus()
}
